message:
Principais componentes ideológicos do cristianismo:

(1) - Universalismo com base na origem comum divina - (Todas as almas e raças foram criadas segundo o desígnio de Deus, como tal não podes desvalorizar o valor de algumas delas como menor a outras);

(2) - Igualitarismo intrínseco e irrevogável - (Todas as almas são iguais perante Deus. Como tal um homem não pode ser considerado superior a outros homens, mesmo que possua um alto nível de intelecto ou capacidade física);

(3) - Controlo da sociedade através do uso da moralidade - (A moralidade provém de uma origem muito mais prática do que a maioria pensa, a lógica que a originou não se baseia em ordens de natureza transcendente mas em meras noções de utilidade, o que é mais útil para uma sociedade é automaticamente designado como moral/bom. No caso da moralidade cristã o homem idealizado é o homem pacífico e obediente ao instinto gregário);

(4) - Método de recompensa vs punição - (As noções de inferno e paraíso são uma consolidação deste método de controlo social, um aumento do poder da moralidade sobre a consciência humana, isto pois os humanos não seguem regras cujo cumprimento não seja vantajoso);

(5) - Idealização da "fé" acima de quaisquer virtudes humanas - (O cristianismo coloca a fé acima de quaisquer virtudes ou habilidades "terrenas", assim desvalorizando a ideia de qualquer tipo de aperfeiçoamento individual);

(6) - O cristianismo é baseado no universalismo. Isto é demonstrado a partir de frases como "todas as almas são iguais perante Deus".

Os dois principais constituintes ideológicos do anti-racismo são o igualitarismo e o universalismo, como o cristianismo também professa ambas estas características é lógico que o cristianismo não é compatível com qualquer tipo de identitarismo, que é por sua vez constituído pelas ideias de hierarquia natural e elitismo. 

O igualitarismo e universalismo também são as duas características principais do marxismo, o que confere imensa piada ao estereótipo do "cristão anti-comunista", um indivíduo que odeia uma ideologia constituída pelas mesmas raízes que a sua religião.
